import React from 'react';
import {thestreams} from '../data';
import {themovies} from '../data';

const Streams = () => {
  return (
    <div>
      <h1>Streams Page</h1>
      {themovies.map((movie, index) => (
          <div key={index}>
              <h3>Name: {movie.title}</h3>
              <p>Genres:</p>
          </div>
      ))}
    </div>
  );
};

export default Streams;
